  `main_table_schema` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `main_table_name` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `resource_name` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '资源名称\r\n            用于路径和权限',
  `is_real` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0',
  `is_tree` char(1) COLLATE utf8_bin NOT NULL COMMENT '是否树状数据',
  `parent_field_name` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '上级字段名称\r\n            树状数据时使用',
  `table_comment` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '说明',
  `table_other_comment` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '其它说明',
  `query_mode` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '查询条件模式\r\n            toolbar      工具栏样式，尽量在一行\r\n            ordinary    普通模式， 一个条件一行 ， 最后是关键字查询',
  `is_build_ui` char(1) COLLATE utf8_bin NOT NULL COMMENT '是否生成界面',
  `is_build_menu` char(1) COLLATE utf8_bin NOT NULL COMMENT '是否生成菜单',
  `is_build_rbac` char(1) COLLATE utf8_bin DEFAULT NULL,
  `java_name` varchar(50) COLLATE utf8_bin NOT NULL COMMENT 'Java名称',
  `business_name` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '业务名称列',
  `business_key` varchar(299) COLLATE utf8_bin DEFAULT NULL COMMENT '业务主键列',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_user_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '创建人',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `update_user_id` char(32) COLLATE utf8_bin DEFAULT NULL COMMENT '修改人',
  `version_no` int(11) NOT NULL COMMENT '版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='表设置';

-- ----------------------------
-- Records of tcg_table_config
-- ----------------------------

