-- ----------------------------
-- Table structure for tcg_templet
-- ----------------------------
DROP TABLE IF EXISTS `tcg_templet`;
CREATE TABLE `tcg_templet` (
  `id` char(32) COLLATE utf8_bin NOT NULL,
  `group_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '模板组',
  `file_out_dir` varchar(200) COLLATE utf8_bin NOT NULL COMMENT '生成文件外部文件夹',
  `file_inner_dir` varchar(200) COLLATE utf8_bin NOT NULL COMMENT '生成文件内部文件夹',
  `file_type` varchar(10) COLLATE utf8_bin NOT NULL COMMENT '生成文件的文件类型\r\n            如 jsp , js ,vue ,java等',
  `file_suffix` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '生成文件的后缀\r\n            如 jsp , js ,vue ,java等',
  `templet_title` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '模板标题',
  `is_rbac_sql` char(1) COLLATE utf8_bin NOT NULL,
  `is_menu_sql` char(1) COLLATE utf8_bin NOT NULL,
  `is_dict_sql` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0',
  `is_ui` char(1) COLLATE utf8_bin NOT NULL COMMENT '是否UI',
  `effective_real` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '只对关联表有效',
  `effective_tree` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '只对树有效',
  `effective_single` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '只对单表有效',
  `effective_view` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否只对视图有效',
  `have_object_name` char(1) COLLATE utf8_bin NOT NULL DEFAULT '1' COMMENT '文件名是否要包含对象名',
  `templet_content` longtext COLLATE utf8_bin NOT NULL COMMENT '模板内容',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_user_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '创建人',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `update_user_id` char(32) COLLATE utf8_bin DEFAULT NULL COMMENT '修改人',
  `version_no` int(11) NOT NULL COMMENT '版本',
  `delete_flag` char(1) COLLATE utf8_bin NOT NULL COMMENT '删除标志',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='模板';

-- ----------------------------
-- Records of tcg_templet
-- ----------------------------

-- ----------------------------
-- Table structure for tcg_templet_group
