  `create_user_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '创建人',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `update_user_id` char(32) COLLATE utf8_bin DEFAULT NULL COMMENT '修改人',
  `version_no` int(11) NOT NULL COMMENT '版本',
  `delete_flag` char(1) COLLATE utf8_bin NOT NULL COMMENT '删除标志',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='模板组';

-- ----------------------------
-- Records of tcg_templet_group
-- ----------------------------

-- ----------------------------
-- Table structure for tcg_templet_group_operation
-- ----------------------------
DROP TABLE IF EXISTS `tcg_templet_group_operation`;
CREATE TABLE `tcg_templet_group_operation` (
  `id` char(32) COLLATE utf8_bin NOT NULL,
  `group_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '模板组',
  `operation_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '操作',
  `icons` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '图标',
  `styles` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '样式',
  `classs` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT 'Class',
  `position` varchar(10) COLLATE utf8_bin NOT NULL COMMENT '位置\r\n            top     上面，    toolbar\r\n            right   右边，  操作列中\r\n            all      两个地方都有',
  `sort` int(11) NOT NULL DEFAULT '0',
  `other` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '其它',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='模板组操作定义';

