-- ----------------------------
-- Table structure for ts_user
-- ----------------------------
DROP TABLE IF EXISTS `ts_user`;
CREATE TABLE `ts_user` (
  `id` char(32) COLLATE utf8_bin NOT NULL COMMENT 'ID',
  `user_name` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '用户姓名',
  `login_name` varchar(20) COLLATE utf8_bin NOT NULL COMMENT '登录名',
  `login_password` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '登录密码',
  `salt` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '加密盐',
  `status` char(1) COLLATE utf8_bin NOT NULL COMMENT '状态\r\n            字典类型: user_status',
  `lead_id` char(32) COLLATE utf8_bin DEFAULT NULL COMMENT '上级领导ID',
  `phone` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '电话',
  `email` varchar(60) COLLATE utf8_bin DEFAULT NULL COMMENT '邮箱',
  `avatar_url` varchar(220) COLLATE utf8_bin DEFAULT NULL COMMENT '头像',
  `open_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '微信ID',
  `union_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '微信唯一ID',
  `system_admin` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '系统管理人员',
  `dep_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '部门ID',
  `organ_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '机构ID',
  `remark` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `delete_flag` char(1) COLLATE utf8_bin NOT NULL COMMENT '删除标志',
  `create_user_id` char(32) COLLATE utf8_bin NOT NULL COMMENT '创建人ID',
  `create_user_name` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '创建人名称',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_user_id` char(32) COLLATE utf8_bin DEFAULT NULL COMMENT '修改人ID',
  `update_user_name` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '修改人名称',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `version_no` int(11) NOT NULL COMMENT '版本',
  `tenant_id` char(32) COLLATE utf8_bin DEFAULT NULL COMMENT '租户ID',
  PRIMARY KEY (`id`),
  KEY `AK_Identifier_2` (`login_name`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='用户';

